import React,{useState,useEffect} from 'react'
import axios from 'axios'

const Test = () => {
    const [reviews, setReviews] = useState([])

    useEffect(() => {
        axios.get('http://localhost:5000/api/all-reviews')
      .then((allReviews) => {
       setReviews(allReviews.data)
      })
      },[])

    return(
        <>
        <div>
            test
        </div>
        {
      reviews.map(item => {
        return <h1>{item.title}</h1>
      })
    }
        </>
    )
}

export default Test
